window.bookSummaryJSON = "<p><b>Kresley Cole’s </b><b><i>New York Times</i></b><b> best-selling Arcana Chronicles series comes to a spectacular and fiery conclusion in this final installment.</b></p> <p><b>When even the gods hold their breath...</b></p> <p>To defeat the emperor and Fortune, Evie, the great Empress of Arcana, must repair her bond with Death, despite the earth-shattering developments between them.</p> <p><b>...and danger lurks in every shadow...</b></p> <p>Their allies—a sea witch, a band of roving warriors, and more than a couple of rogues—overcome terrifying obstacles to help them. But when Jack makes a shocking discovery, the fallout threatens to tear their alliance apart.</p> <p><b>...one girl could deliver salvation—or doom.</b></p> <p>If the empress and her friends can remain united, will their powers be enough to defeat a catastrophic curse on the world, or will hellfire reign forever? The end looms for us all until the best hand wins....</p>"; 
